VALUES ('3254563259291', 'Sorbet fraise Morceaux de fraise', 'Sorbet à la fraise 92% : purées de fraise 41,4%, eau, sirop de glucose-fructose, sucre, sirop de glucose, jus concentré de citron, gélifiants : pectines, gomme tara, gomme xanthane, colorants : rouge de betterave, rocou, arôme naturel, protéines de pois hydrolysées. Préparation de morceaux de fraise 8% : morceaux de fraise 5,2%, purée de fraise 0,1%, sucre, sirop de glucose-fructose, amidon modifié de maïs, eau, gélifiants : carraghénanes, gomme xanthane, correcteur d\'acidité : acide citrique, jus concentré de fruits rouges. Pourcentages exprimés sur le total de la recette.', 'https://static.openfoodfacts.org/images/products/325/456/325/9291/front_fr.10.400.jpg', '0.5', '0.1', '27.4', '25.6', '', '0.5', '0.05', '0.0196850393700787', '', '0');

