VALUES ('3254563260228', '6 cônes vanille avec pépites de nougatine', 'Glace vanille 70.2% : eau, sucre, lactose (contient _lait_) et protéines de _lait_, graisse végétale (coprah), sirop de glucose, émulsifiant : mono - et diglycérides d\'acides gras, stabilisants : gomme de guar, farine de graines de caroube, arômes naturels de vanille 0.2%, colorant : caroténoïdes, gousses de vanille épuisées broyées 0.03%. Gaufrette 16% : farine de blé (contient _gluten_), sucre, graisse végétale (coco), émulsifiant : lécithine de _soja_, sel, colorant : caramel ordinaire, poudre à lever : carbonates de magnésium. Pâte à glacer au cacao maigre en enrobage et décor 11.6% : graisses végétales (coprah, colza), sucre, cacao maigre en poudre 1.2%, émulsifiant : lécithine de _soja_. Nougatine 2.2% : sucre, amandes (_fruits à coque_) et noisettes (_fruits à coque_) 0.8% en proportions variables.', 'https://static.openfoodfacts.org/images/products/325/456/326/0228/front_fr.6.400.jpg', '12.1', '10.3', '37.9', '25.8', '', '2.3', '0.14', '0.0551181102362205', '', '0');

